import React, { useState, useEffect } from 'react';
import List from "./List";

const server_url = 'http://localhost:11037';

function Lists(props) {
    var idcount = 0;

    const getListsRequest = async () => {
        const options = {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
          }
        }
        
        const response = await fetch(server_url + '/lists', options);
    
        const res = await response.json();
    
        console.log(res);

        return (res);
    }
    
    useEffect(() => {
        getListsRequest();
    }, []);

    return (
        <div>
            <h1>Lists</h1>

            <div className="item-container">
              {getListsRequest().map((list, index)=> (
                <div key={++idcount} className="items">
                    <img src={list.title} alt='movie' className='movie-image'></img>
                    <div className="overlay"></div>
                </div>
              ))}
      </div>

            <List items={props.movies} />
        </div>
    )
}

export default Lists;
